$lightgrey: #e5e5e5;
$grey: #cccccc;

img {
    //width: 350px;
    //height: fit-content;
    max-height: 200px;
    background-size: cover;
    
    border-radius: 10px;
}

:root, .menu {
    &::-webkit-scrollbar {
        background-color: inherit;
        
    }
    &::-webkit-scrollbar-thumb {
        background-color: grey; /* 스크롤바 막대 색상 */
        border: 4px solid #ffffff; /* 스크롤바 막대 테두리 설정  */
        border-radius: 12px 12px 12px 12px;
        &:hover {
            background-color : rgb(185, 185, 185);
        }
    }
    &::-webkit-scrollbar-track {
        background-color: #ffffff; /* 스크롤바 뒷 배경 색상 */
    }
}

:root {
    overflow-x: hidden;
}

body {
 
    .fa-youtube {
        color: red;
    }

    .header{
        height: 60px;
        width: 100%;
        background-color: white;
        z-index: 5;

        position: fixed;
        top:0;

        display: flex;     
        justify-content: space-between;

        .menuicon {
            display: flex;
            align-items: center;
            cursor: pointer;
            margin-right: 20px;
            width:20%;

            .fa-bars {
                font-size: 20px;
                padding: 12px;
                margin-right: 15px;
                color: #030303;
                &:hover {
                    background-color: $lightgrey;
                    border-radius: 50%;
                }

                @media screen and (max-width : 800px) {
                    font-size: 10px;
                    margin-right: 0px;
                    padding: 6px;
                }
            }

            .fa-youtube {
                font-size: 30px;
                margin-right: 5px;
                @media screen and (max-width : 800px) {
                    font-size: 15px;
    
                }
            }

            span {
                font-size: 20px;
                font-weight: lighter;
                font-family: fantasy;
                @media screen and (max-width : 800px) {
                    font-size: 10px;
    
                }
            }
        }

        .search {
            display: flex;
            align-items: center;
            flex-shrink: 1;
            width: 60%;
            .search-input {             
                flex-basis: 40px; 
                flex-grow: 1;
                flex-shrink: 1;
                display: flex;
                align-items: center;
                justify-content: flex-end;

                

                .search-left {
                    display: flex;
                    width: 20px;
                    height: 42px;
                    border-top: solid 1px $grey;
                    border-left: solid 1px $grey;
                    border-bottom: solid 1px $grey;  
                    border-radius: 20px 0 0 20px;

                    .fa-magnifying-glass {
                        font-size: 14px;
                        margin: auto;
                        display: none;
                    }

                    @media screen and (max-width : 800px) {
                        width: 10px;
                        height: 20px;
                        border-radius: 10px 0 0 10px;
                    }
                }

                &:focus-within  {
                    .fa-magnifying-glass {
                        display: inline-block;
                        text-align: center;
                        @media screen and (max-width : 800px) {
                            font-size: 10px;
                        }
                    }
                    
                    .search-left {
                        border-color: #1c62b9;
                        width: 50px;
                        @media screen and (max-width : 800px) {
                            width: 20px;
                        }
                    }
                }

                input {
                    display: flex;
                    flex-basis: 20px; 
                    flex-grow: 1;
                    flex-shrink: 1;
                    max-width: 360px;
                    height: 40px;
                    border-top: solid 1px $grey;
                    border-right: solid 1px $grey;
                    border-bottom: solid 1px $grey;
                    border-left: none;
                    color: #888888;
                    font-size: 16px;

                    @media screen and (max-width : 800px) {
                        height: 18px;
                        font-size: 8px;
                    }
    
                    &:focus {
                        border-color: #1c62b9;
                    }
                }   
            }

            .search-button {
                position:relative;
                width: 60px;
                height: 44px;
                border-top: solid 1px $grey;
                border-right: solid 1px $grey;
                border-bottom: solid 1px $grey;
                background-color: #f8f8f8;
                border-radius: 0 20px 20px 0;

                @media screen and (max-width : 800px) {
                    height: 22px;
                    width: 30px;
                    border-radius: 0 10px 10px 0;
                }

                .fa-magnifying-glass {
                    font-size: 17px;
                    @media screen and (max-width : 800px) {
                        font-size: 10px;
                    }
                }
                &:hover {
                    background-color: #f0f0f0;
                    &::after {
                        position: absolute;
                        top:50px;
                        right: 10px;
                        content: "검색";
                        
                        background-color: grey;
                        color: white;
                        border-radius: 5px;
                        padding: 5px;

                        @media screen and (max-width : 800px) {
                            content: none;
                        }
                    }
                }
            }

            .mic-button {
                position:relative;
                width: 40px;
                height: 40px;
                margin-left: 15px;
                background-color: rgb(236, 236, 236);
                border-radius: 20px;
                flex-shrink: 0;

                @media screen and (max-width : 800px) {
                    width: 20px;
                    height: 20px;
                    margin-left: 5px;
                    background-color: rgb(236, 236, 236);
                    border-radius: 10px;
                }
                &:hover {
                    background-color: lightgrey;
                    &::after {
                        position: absolute;
                        width:auto;
                        top:50px;
                        content: "음성으로 검색";
                        white-space: nowrap;
                        display: inline-block;
                        
                        background-color: grey;
                        color: white;
                        border-radius: 5px;
                        padding: 5px;
                        @media screen and (max-width : 800px) {
                            content: none;
                        }

                    }
                }
            }
            
        }


        .more {
            display: flex;
            align-items: center;
            width: 20%;

            .fa-ellipsis-vertical {
                padding: 14px;
                margin: auto 10px;
                cursor: pointer;
            }

            i {
                display: flex;
                width: 40px;
                height: 40px;
                background-color: #ffffff;
                margin-right: 20px;
                font-size: 20px;
                font-weight: lighter;
                align-items: center;
                justify-content: space-around;
                cursor: pointer;
                &:hover {
                    background-color: $lightgrey;
                    border-radius: 50%;
                }

                @media screen and (max-width : 800px) { 
                    width: 20px;
                    height: 20px;
                    margin-right: 10px;
                    font-size: 10px;
                }
            }

        }
    }

    .body {
        position: relative;
        top:80px;
        .menu {
            background-color: white;
            z-index: 5;

            position: fixed;
            
            display: flex;
            flex-direction: column;
            width: 200px;
            $height: calc(100vh - 90px);
            height: $height;
            overflow-y: scroll;
            overflow-x: hidden;
            min-width: 50px;

            @media screen and (max-width : 800px) {
                width: 60px;

            }
            
            
           
            
            .main, .user, .subscribe, .search, .more, .setting {
                margin-top: 10px;
                margin-left: 10px;
                div {
                    font-size: 18px;
                    display: flex;
                    align-items: center;
                    cursor: pointer;
                    @media screen and (max-width : 800px) {
                        font-size : 10px;
                    }
                    &:hover {
                        background-color: $lightgrey;
                        border-radius: 7px;
                    }
                    span{
                        margin-left: 10px;
                        margin-right: 10px;
                    }
                    .fa-chevron-right {
                        font-size: 12px;
                    }
                }
                ul {
                    list-style:none;
                    padding-left: 0px;
                    margin-top: 0px;
                    @for $i from 1 through 10 {
                        li:nth-child(#{$i}) {
                            display: flex;
                            align-items: center;
                            height: 30px;
                            padding-top: 5px;
                            padding-bottom: 5px;
                            cursor: pointer;
                            
                            &:hover {
                                background-color: $lightgrey;
                                border-radius: 7px;
                            }
                            i {
                                margin-left: 10px;
                            }
                            span {
                                margin-left: 20px;
                                overflow: hidden;
                                text-overflow: ellipsis;
                                white-space: nowrap;
                                font-size: 15px;
                            }
                        }
                    }
                }
                border-bottom: 1px solid $lightgrey;
            }
    
            
        }

        .container {  
            position:relative;
            left:210px;
            display:flex;
            justify-content: center;
            padding: 10px;
            flex-wrap: wrap;
            $width: calc(100% - 220px);
            width: $width;

            @media screen and (max-width : 800px) {
                left:70px;
                width: calc(100% - 100px);
                
            }
            .video {
                display: flex;
                align-content: flex-start;
                flex-direction:row;
                flex-basis: 300px;
                flex-grow: 1;
                flex-shrink: 1;
                flex-wrap: wrap;
                margin: 10px;
                cursor: pointer;
                @media screen and (max-width : 900px) {
                    flex-basis: 205px;     
                }

                img {
                    object-fit: cover;
                    width: 100%;
                    transition: 0.3s;
                    //height: 80%;
                    &:hover {
                        transform: scale(1.04);
                        cursor: pointer;
                    }
                }

                
                .video--detail {
                    display: flex;
                    margin: 10px;
                    
                    
                    .fa-circle-user {        
                        font-size: 30px;
                        margin-right: 10px;
                        @media screen and (max-width : 900px) {
                            font-size: 20px;   
                        }
             
                    }
                    .video--detail--text {

                        div {
                            padding-bottom: 2px;
                        }
                        .username, .info {
                            //display: inline-flex;
                            font-size: 13px;
                            color: grey;
                            

                        }

                        @media screen and (max-width : 900px) {
                            .title {
                                font-size: 15px;
                            }
                            .username, .info {
                                font-size: 10px;   
                            }
                            
                        }

                    }
                }
            }
        }
    }
    
}

button {
    border: 0;
    outline: 0;
    cursor: pointer;
}
  
input {
    outline-style: none;
}
